import React from 'react';
import { Navbar, Nav, NavItem, NavDropdown, MenuItem } from 'react-bootstrap';

// const TopNav = () => {
//   return (
//     <nav className="navbar navbar-inverse bg-inverse">
//     <span className="navbar-brand">Study Buddy</span>
//     <span className="navbar-owner" text-align='right'>Powered by MasNut</span>
//     </nav>
//   );
// };
const TopNav = () => {
  return (
    <Navbar inverse collapseOnSelect>
      <Navbar.Header>
        <Navbar.Brand>
          React-Bootstrap
        </Navbar.Brand>
      </Navbar.Header>
      <Navbar.Collapse>
        <Nav pullRight>
          <Nav.Text>Powered by MasNut</Nav.Text>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default TopNav;
